On the promontory overlooking the Trousdale Estates and high above the famed Sunset Strip with views from downtown Los Angeles and the snow-capped mountains beyond, to the Getty Center, Santa Monica, Catalina Island, and the Pacific Ocean, is Gilcrest Drive. -

Sold & Listed By:
@williamsandwilliams

@kevindijamco offering this $7,850,000 Los Angeles home with over 12,500 sq ft including 6 bedrooms, 9 bathrooms and 7 fireplaces sitting on 2.5 acres. 

Discover the wonders of this awe inspiring French styled Chateau nestled on a majestic crown with rolling hills of tranquility and serenity. Beautiful winding roads lead through 'The Country', a highly coveted exclusive gated community where a lifestyle of excellence awaits. Quality craftsmanship and architectural design are featured all through this timeless classic where you'll be captivated by the grandeur of the towering cathedral glass windows, custom double door entry, and the magnificence of the grand foyer with dramatic high cathedral ceilings and designer skylights, adding glow and splendor.

Listed by @kevindijamco
